  "inlineSchema": "// Course Service Database Schema\ngenerator client {\n  provider = \"prisma-client-js\"\n  output   = \"../../../generated/course\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"COURSE_DATABASE_URL\")\n}\n\n// Post service only stores author ID reference, not full user data\nmodel Post {\n  id          String    @id @default(uuid())\n  title       String\n  content     String\n  excerpt     String?\n  slug        String?   @unique\n  published   Boolean   @default(false)\n  authorId    String    @map(\"author_id\")\n  tags        String[]  @default([])\n  createdAt   DateTime  @default(now()) @map(\"created_at\")\n  updatedAt   DateTime  @updatedAt @map(\"updated_at\")\n  publishedAt DateTime? @map(\"published_at\")\n\n  @@map(\"posts\")\n}\n\n// Post service events for analytics\nmodel PostEvent {\n  id        String   @id @default(uuid())\n  postId    String   @map(\"post_id\")\n  eventType String   @map(\"event_type\")\n  authorId  String   @map(\"author_id\")\n  eventData Json?    @map(\"event_data\")\n  createdAt DateTime @default(now()) @map(\"created_at\")\n\n  @@map(\"post_events\")\n}\n\n// Post view analytics\nmodel PostView {\n  id        String   @id @default(uuid())\n  postId    String   @map(\"post_id\")\n  viewerId  String?  @map(\"viewer_id\")\n  ipAddress String?  @map(\"ip_address\")\n  userAgent String?  @map(\"user_agent\")\n  createdAt DateTime @default(now()) @map(\"created_at\")\n\n  @@map(\"post_views\")\n}\n\nmodel HomeSlider {\n  id        String   @id @default(uuid())\n  image     String\n  createdAt DateTime @default(now()) @map(\"created_at\")\n  updatedAt DateTime @default(now()) @map(\"updated_at\")\n}\n\nmodel Category {\n  id            String        @id @default(uuid())\n  name          String\n  isDeleted     Boolean       @default(false)\n  type          CategoryType\n  createdAt     DateTime      @default(now()) @map(\"created_at\")\n  updatedAt     DateTime      @default(now()) @map(\"updated_at\")\n  subCategories SubCategory[]\n  courses       Course[]\n  contents      Content[]\n\n  @@map(\"category\")\n}\n\nmodel SubCategory {\n  id         String   @id @default(uuid())\n  name       String\n  categoryId String\n  isDeleted  Boolean  @default(false)\n  createdAt  DateTime @default(now()) @map(\"created_at\")\n  updatedAt  DateTime @default(now()) @map(\"updated_at\")\n\n  category Category @relation(fields: [categoryId], references: [id])\n  courses  Course[]\n\n  @@map(\"sub_category\")\n}\n\nmodel HomeCategory {\n  id        String             @id @default(uuid())\n  name      String\n  isDeleted Boolean            @default(false)\n  createdAt DateTime           @default(now()) @map(\"created_at\")\n  updatedAt DateTime           @default(now()) @map(\"updated_at\")\n  items     HomeCategoryItem[]\n\n  @@map(\"home_category\")\n}\n\nmodel HomeCategoryItem {\n  id             String     @id @default(uuid())\n  homeCategoryId String\n  courseId       String     @db.Uuid\n  type           CourseType\n  createdAt      DateTime   @default(now()) @map(\"created_at\")\n  updatedAt      DateTime   @default(now()) @map(\"updated_at\")\n\n  homeCategory HomeCategory @relation(fields: [homeCategoryId], references: [id])\n  course       Course       @relation(fields: [courseId], references: [id])\n\n  @@map(\"home_category_item\")\n}\n\nmodel Course {\n  id             String   @id @default(uuid()) @db.Uuid\n  image          String?\n  name           String\n  description    String?\n  duration       Int?\n  videoCount     Int      @default(0)\n  enrolledCount  Int      @default(0)\n  isDeleted      Boolean  @default(false)\n  rating         Float    @default(0)\n  date           DateTime @default(now())\n  parentCourseId String?  @db.Uuid\n  createdAt      DateTime @default(now())\n  updatedAt      DateTime @updatedAt\n  categoryId     String?\n  subCategoryId  String?\n\n  parentCourse     Course?            @relation(\"CourseToParent\", fields: [parentCourseId], references: [id])\n  subCourses       Course[]           @relation(\"CourseToParent\")\n  users            UserOnCourse[]\n  category         Category?          @relation(fields: [categoryId], references: [id])\n  subCategory      SubCategory?       @relation(fields: [subCategoryId], references: [id])\n  HomeCategoryItem HomeCategoryItem[]\n  CourseSection    CourseSection[]\n  reviews          Review[]\n  ratings          Rating[]\n\n  @@map(\"course\")\n}\n\nmodel UserOnCourse {\n  id        String       @id @default(uuid()) @db.Uuid\n  userId    String\n  courseId  String       @db.Uuid\n  status    CourseStatus @default(IN_PROGRESS)\n  createdAt DateTime     @default(now()) @map(\"created_at\")\n  updatedAt DateTime     @default(now()) @map(\"updated_at\")\n\n  course Course @relation(fields: [courseId], references: [id])\n}\n\nmodel CourseSection {\n  id          String   @id @default(uuid())\n  title       String\n  description String?\n  courseId    String   @map(\"course_id\") @db.Uuid\n  createdAt   DateTime @default(now()) @map(\"created_at\")\n  updatedAt   DateTime @updatedAt @map(\"updated_at\")\n\n  course     Course     @relation(fields: [courseId], references: [id])\n  activities Activity[]\n\n  @@map(\"course_section\")\n}\n\nmodel Activity {\n  id        String       @id @default(uuid())\n  title     String\n  type      ActivityType @default(LESSON)\n  content   String?\n  videoUrl  String?      @map(\"video_url\")\n  duration  Int?\n  order     Int          @default(0)\n  sectionId String       @map(\"section_id\")\n  createdAt DateTime     @default(now()) @map(\"created_at\")\n  updatedAt DateTime     @updatedAt @map(\"updated_at\")\n\n  section CourseSection @relation(fields: [sectionId], references: [id])\n\n  @@map(\"activity\")\n}\n\nmodel Review {\n  id        String   @id @default(uuid())\n  courseId  String   @db.Uuid\n  userId    String\n  text      String\n  createdAt DateTime @default(now()) @map(\"created_at\")\n  updatedAt DateTime @updatedAt @map(\"updated_at\")\n\n  course Course @relation(fields: [courseId], references: [id])\n\n  @@map(\"review\")\n}\n\nmodel Rating {\n  id        String   @id @default(uuid())\n  userId    String\n  courseId  String   @db.Uuid\n  rating    Int\n  comment   String?\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  course Course @relation(fields: [courseId], references: [id])\n}\n\nmodel Faq {\n  id        String   @id @default(uuid())\n  question  String\n  answer    String\n  isDeleted Boolean  @default(false)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"faq\")\n}\n\n// Content Types - Stores all categories of content\nmodel ContentType {\n  id          String   @id @default(uuid())\n  name        String\n  description String?\n  createdAt   DateTime @default(now()) @map(\"created_at\")\n  updatedAt   DateTime @updatedAt @map(\"updated_at\")\n\n  contents Content[]\n\n  @@map(\"content_types\")\n}\n\n// Contents - Stores all content items (regardless of type)\nmodel Content {\n  id           String    @id @default(uuid())\n  typeId       String    @map(\"type_id\")\n  categoryId   String?   @map(\"category_id\")\n  title        String\n  description  String?\n  fileUrl      String?   @map(\"file_url\")\n  thumbnailUrl String?   @map(\"thumbnail_url\")\n  author       String?\n  content      String?\n  publishedAt  DateTime? @map(\"published_at\")\n  createdAt    DateTime  @default(now()) @map(\"created_at\")\n  updatedAt    DateTime  @updatedAt @map(\"updated_at\")\n\n  type     ContentType @relation(fields: [typeId], references: [id])\n  category Category?   @relation(fields: [categoryId], references: [id])\n\n  @@map(\"contents\")\n}\n\nenum CategoryType {\n  NORMAL\n  FEATURE\n}\n\nenum CourseType {\n  NORMAL\n  FEATURE\n}\n\nenum ActivityType {\n  LESSON\n  VIDEO\n  QUIZ\n  ASSIGNMENT\n  RESOURCE\n}\n\nenum CourseStatus {\n  IN_PROGRESS\n  DONE\n}\n",
